func (e *Icon) Visit() (*Icon, error) {
	if e == nil {
		return gex.P(IconDefault), nil
	}

	if _, ok := iconOptions[*e]; !ok {
		return nil, grr.Wrap(grr.ErrInvalidEnumValue, "invalid enum %s value %v", "Icon", *e)
	}

	return e, nil
}
